import Resizer from 'react-image-file-resizer'

export const imageToBase64 = (file: any, avatar: boolean) => {
  if (file === undefined) return
  
  let quality = 100
  const MAX_WIDTH = avatar ? 250 : 1000
  const MAX_HEIGHT = avatar ? 250 : 1000

  if (file.size > 4000000) quality = 80 // 4MB
  if (file.size > 8000000) quality = 75 // 8MB
  if (avatar) quality = 100

  return new Promise((resolve) => {
    Resizer.imageFileResizer(
      file,
      MAX_WIDTH,
      MAX_HEIGHT,
      "base64",
      quality,
      0,
      (uri) => {
        resolve(uri)
      },
      "base64"
    )
  })
}

